        [HttpPost]
        [Route("AddReport")]
        public async Task<ApiResponse> AddReport(string eventId, string reportUrl, [FromBody]ReportFile report)
        {
            try
            {
                Model.Dto.User sender = await _spUserService.GetCurrentUser();
                string reportId = await _summaryService.AddReport(report);
                string html = _summaryService.BuildHtmlEmail(reportUrl, eventId, reportId);
                _summaryService.SendReport(sender.UserPrincipalName, html);
                return ApiUtil.CreateSuccessfulResult();
            }
            catch (Exception e)
            {
                return ApiUtil.CreateFailResult(e.ToString());
            }
        }


        [HttpGet]
        [Route("GetImage/{reportId}")]
        [OverrideAuthentication]
        public async Task<HttpResponseMessage> GetImage(string reportId)
        {
            var result = new HttpResponseMessage();
            try
            {
                //var avatar = await _sPUserService.GetAvatarByUserId(userId);
                //string file = "";
                string reportContent = _summaryService.GetReportContentByEventId(reportId);
                var bytes = Convert.FromBase64String(reportContent);
                result.Content = new ByteArrayContent(bytes);
                result.Content.Headers.ContentType = new MediaTypeHeaderValue("image/png");

                return result;
            }
            catch (Exception e)
            {
                result.StatusCode = HttpStatusCode.NotFound;
                return result;
            }
        }

        // GET: api/favoriterestaurant/getall
        [HttpPost]
        [Route("SendReport")]
        public async Task<ApiResponse> SendReport([FromBody]Report report)
        {
            try
            {

                //Model.Dto.User sender = await _spUserService.GetCurrentUser();
                await _summaryService.SendEmailReportAsync(report);
                return ApiUtil.CreateSuccessfulResult();
            }
            catch (Exception e)
            {
                return ApiUtil.CreateFailResult(e.ToString());
            }
        }
